import { Injectable } from '@angular/core';
import * as moment from 'moment';
import { Testimony } from '../models/testimony'

@Injectable({
  providedIn: 'root'
})
export class TestimonyService {

  testimonies: Array<Testimony>;

  constructor() { 
    let date1 = moment("10-5-2020","MM-DD-YYYY");
    this.testimonies = new Array<Testimony>();
    this.testimonies = [
      {idTestimony: 1, fullName: "Thomas Muller",commentary: "Hey your website is awesome your are great!.",profile: "data:image/jpeg;base64,",country:{name:"Argentina",alpha2Code:"ar", alpha3Code:"arg"},datePosted:date1.toDate()},
      {idTestimony: 2, fullName: "Cavani",commentary: "Hey your website is awesome your are great!.",profile: "data:image/jpeg;base64,",country:{name:"Brazil",alpha2Code:"br", alpha3Code:"arg"},datePosted:date1.toDate()},
      {idTestimony: 3, fullName: "Dembele",commentary: "Hey your website is awesome your are great!.",profile: "data:image/jpeg;base64,",country:{name:"Germany",alpha2Code:"de", alpha3Code:"arg"},datePosted:date1.toDate()},
      {idTestimony: 4, fullName: "Arjen Robben",commentary: "Hey your website is awesome your are great!.",profile: "data:image/jpeg;base64,",country:{name:"Portugal",alpha2Code:"pt", alpha3Code:"arg"},datePosted:date1.toDate()}
    ];
  }

  getTestimonies(){
    return this.testimonies;
  }

  getIDavailable(){
    var maxid: number;
    maxid = 0;
    for ( var i = 0; i < this.testimonies.length;i++){
      if(maxid < this.testimonies[i].idTestimony){
      maxid = this.testimonies[i].idTestimony;
      }
    }
    return (maxid + 1);
  }

  addTestimony(testimony: Testimony){
    testimony.idTestimony = this.getIDavailable();
    this.testimonies.push(testimony);
  }

  editTestimony(testimony: Testimony){
    var idDetele = this.testimonies.findIndex((value: Testimony) => value.idTestimony == testimony.idTestimony);
    this.testimonies.splice(idDetele,1,testimony);
  }

  deleteTestimony(testimony: Testimony){
    var idDetele = this.testimonies.findIndex((value: Testimony) => value.idTestimony == testimony.idTestimony);
    this.testimonies.splice(idDetele,1);
  }

}
